import React from "react";

function Scheduler() {
  return (
    <div>
      Scheduler
      <ul>
        <li>Pazartesi</li>
        <li>Salı</li>
        <li>Çarşamba</li>
        <li>Perşembe</li>
        <li>Cuma</li>
        <li>Cumartesi</li>
        <li>Pazar</li>
      </ul>
    </div>
  );
}

export default Scheduler;
